\u0412\u043e\u043f\u0440\u043e\u0441 18.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Появившаяся в революционные годы печка "кушала" прямо-таки по-буржуйски;
в анекдоте немцы не могли понять, что такое "буржуйка" - женщина или
печь, пока не пришел Штирлиц и не стал ее топить.

\u0412\u043e\u043f\u0440\u043e\u0441 14.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Плацебо - ложное лекарство, вещество без явных лечебных свойств;
лечебный эффект плацебо связан с верой самого пациента в действенность
препарата.

\u0412\u043e\u043f\u0440\u043e\u0441 30.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
На картине Сурикова опальная боярыня изображена с поднятой вверх рукой;
демонстративный отказ от участия в церемониале как раз и вызвал гнев
царя.

\u0412\u043e\u043f\u0440\u043e\u0441 21.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Провинция Фарс (искаженное Парс) - колыбель иранской государственности;
от ее названия происходят слова "Персия" и "фарси"; слова "фарс" и
"абсурд" хоть и не синонимы, но понятия весьма близкие.
